import React from 'react';
import { Container, Row, Col, Button } from 'reactstrap'

function PlaneCard(props) {
    return (
        <Col xs="12" md="4" >
            <Button className="cardButton">
                <img className="planeCard" src={props.card.image_uris.border_crop} />
            </Button>
        </Col>
    )
}



export default function Planechase(props) {
    return (
        <Container>
            <Row>
                {props.planechaseState.allPlaneCards.map((card, idx) => <PlaneCard card={card} key={idx} />)}
            </Row>
        </Container>
    )
}
